import React, { useState } from "react";
import "./App.css"; // Assuming you copy styles.css to App.css

function App() {
  const [showModal, setShowModal] = useState(false); // State to control modal
  const [nftInfo, setNftInfo] = useState("");

  const openModal = (nft) => {
    setNftInfo(nft);
    setShowModal(true);
  };

  const closeModal = () => {
    setShowModal(false);
    setNftInfo("");
  };

  const confirmPurchase = () => {
    alert(`You have purchased: ${nftInfo}`);
    closeModal();
  };

  return (
    <div className="App">
      <header>
        <div className="logo">
          <img src={`${process.env.PUBLIC_URL}/images/logoo.png`} alt="EcoNFT Energy Logo" />
        </div>
        <nav>
          <ul>
            <li><a href="#home">Home</a></li>
            <li><a href="#nfts">Buy NFTs</a></li>
            <li><a href="#passive-income">Passive Income</a></li>
          </ul>
        </nav>
        <button id="connect-wallet">Connect Wallet</button>
      </header>

      <section id="hero">
        <h1>Earn Passive Income with Renewable Energy</h1>
        <p>Buy NFTs representing solar panels and wind turbines to earn passive income!</p>
      </section>

      <section id="nfts">
        <h2>Our Energy NFTs</h2>
        <div className="background">
          <div className="left">
            <button
              className="buy-button"
              onClick={() => openModal("Solar Panel NFT")}
            >
              Buy Solar Panel NFT
            </button>
          </div>
          <div className="right">
            <button
              className="buy-button"
              onClick={() => openModal("Wind Turbine NFT")}
            >
              Buy Wind Turbine NFT
            </button>
          </div>
        </div>
      </section>

      <section id="passive-income">
        <h2>Passive Income Tracker</h2>
        <div className="income-tracker">
          <p>Your earnings from active NFTs:</p>
          <div id="income-value">0</div>
        </div>
      </section>

      <footer>
        <p>&copy; 2024 EcoNFT Energy. All rights reserved.</p>
      </footer>

      {showModal && (
        <div id="purchase-modal" className="modal">
          <div className="modal-content">
            <span className="close-btn" onClick={closeModal}>
              &times;
            </span>
            <h2>Confirm Your Purchase</h2>
            <p id="nft-info">You are about to purchase: {nftInfo}</p>
            <div className="modal-buttons">
              <button id="confirm-purchase" onClick={confirmPurchase}>
                Confirm Purchase
              </button>
              <button className="cancel-btn" onClick={closeModal}>
                Cancel
              </button>
            </div>
          </div>
        </div>
      )}
    </div>
  );
}

export default App;
